import React, { useState } from 'react'
// import './App.css';
import Room from './components/Room';

function App(){
  const [roomId, setRoomId] = useState(null)

  return (
    <div>
      <Room setRoomId={setRoomId}/>
      {
        roomId !== null &&
        <Chat roomId={roomId}/>
      }
    </div>
  )

}

export default App
